import React, { useState } from "react";
import CalculatorButton from "./CalculatorButton"

function Calculator() {
  const [prevValue, setPrevValue] = useState(null);
  const [nextValue, setNextValue] = useState("0");
  const [op, setOp] = useState(null);

  useEffect(() => {}, [op, nextValue, prevValue]);

    const CalculatorOperations = {
      "/": (firstValue, secondValue) => firstValue / secondValue,
      "*": (firstValue, secondValue) => firstValue * secondValue,
      "+": (firstValue, secondValue) => firstValue + secondValue,
      "-": (firstValue, secondValue) => firstValue - secondValue,
      "=": (firstValue, secondValue) => secondValue,
    };

    const performOperation = () => {
      let temp = CalculatorOperations[op](
        parseFloat(prevValue),
        parseFloat(nextValue)
      );
      setOp(null);
      setNextValue(String(temp));
      setPrevValue(null);
    };

    const handleNum = (number) => {
      setNextValue(nextValue === "0" ? String(number) : nextValue + number);
    };

    const insertDot = () => {
      if (!/\./.test(nextValue)) {
        setNextValue(nextValue + ".");
      }
    };
    const percentage = () => {
      setNextValue(parseFloat(nextValue) / 100);
      if (prevValue && nextValue === "") {
        setPrevValue(parseFloat(prevValue) / 100);
      }
    };
    const changeSign = () => {
      setNextValue(parseFloat(nextValue) * -1);
    };
    const clearData = () => {
      setNextValue("0");
      setPrevValue(0);
    };

    const handleOperation = (value) => {
      if (Number.isInteger(value)) {
        handleNum(parseInt(value, 10));
      } else if (value in CalculatorOperations) {
        if (op === null) {
          setOp(value);
          setPrevValue(nextValue);
          setNextValue("");
        }
        if (op) {
          setOp(value);
        }
        if (prevValue && op && nextValue) {
          performOperation();
        }
      } else if (value === "c") {
        clearData();
      } else if (value === "\xB1") {
        changeSign();
      } else if (value === ".") {
        insertDot();
      } else if (value === "%") {
        percentage();
      }
    };

  return (
    <div className="calculator">
      <div className="calculator-result">
        <div className="result">{num}</div>
      </div>
      <div className="calculator-keypad">
        <div className="keypad-functions">
         <CalculatorButton value={"H"} />
         <CalculatorButton onClick={clear} value={"C"}/>
         <CalculatorButton onClick={percentage} value={"%"}/>
        </div>
        <div className="keypad-operators">
         <CalculatorButton onClick={handleOperator} value={"+"} />
         <CalculatorButton onClick={handleOperator} value={"-"} />
         <CalculatorButton onClick={handleOperator} value={"*"} />
         <CalculatorButton onClick={handleOperator} value={"/"} />
         <CalculatorButton onClick={calculate} value={"="} />
        </div>
        <div className="keypad-numbers">
         <CalculatorButton onClick={handleNum} value={9} />
         <CalculatorButton onClick={handleNum} value={8} />
         <CalculatorButton onClick={handleNum} value={7} />
         <CalculatorButton onClick={handleNum} value={6} />
         <CalculatorButton onClick={handleNum} value={5} />
         <CalculatorButton onClick={handleNum} value={4} />
         <CalculatorButton onClick={handleNum} value={3} />
         <CalculatorButton onClick={handleNum} value={2} />
         <CalculatorButton onClick={handleNum} value={1} />
        </div>
        <div className="keypad-zero">
        <CalculatorButton onClick={handleNum} value={0} />
        </div>
      </div>
    </div>
  )

}

export default Calculator;
